    download(ctx, url, params = {}) {
      console.log('download', params)
      return ctx.$axios({
        method: 'post',
        url: 'http://' + window.location.host + '/proxy/download',
        data: {
          url: url,
          params: params || {}
        },
        responseType: 'blob'
      }).then(resp => {
        const headers = resp.headers;
        const contentType = headers['content-type'];

        console.log('响应头信息', headers);
        if (!resp.data) {
          console.log('响应异常：', resp);
          return false;
        } else {
          console.log('下载文件：', resp);
          const blob = new Blob([resp.data], {type: contentType});

          const contentDisposition = resp.headers['content-disposition'];
          let fileName = 'unknown';
          if (contentDisposition) {
            fileName = window.decodeURI(resp.headers['content-disposition'].split('=')[1]);
          }
          if (fileName.startsWith('"')) fileName = fileName.substr(1)
          if (fileName.endsWith('"')) fileName = fileName.substr(0, fileName.length - 1)
          console.log('文件名称：', fileName)

          if ('download' in document.createElement('a')) {
            // 非IE下载
            const link = document.createElement('a');
            link.href = window.URL.createObjectURL(blob); // 创建下载的链接
            link.download = fileName; // 下载后文件名
            link.style.display = 'none';
            document.body.appendChild(link);
            link.click(); // 点击下载
            window.URL.revokeObjectURL(link.href); // 释放掉blob对象
            // document.body.removeChild(link); // 下载完成移除元素
          } else {
            // IE10+下载
            window.navigator.msSaveBlob(blob, fileName);
          }
        }
      }).catch(function (error) {
        console.log(error);
      });
    },
