    // 解决js计算误差问题
    // 加法
    accAdd(a, b) {
      let c = 0
      let d = 0
      // let e = 0
      try {
        c = a.toString().split(".")[1].length
      } catch (f) {
        c = 0
      }
      try {
        d = b.toString().split(".")[1].length
      } catch (f) {
        d = 0
      }
      const e = Math.pow(10, Math.max(c, d))
      return (this.accMul(a, e) + this.accMul(b, e)) / e
    },
    // 减法
    accSub(a, b) {
      let c = 0
      let d = 0
      try {
        c = a.toString().split(".")[1].length;
      } catch (f) {
        c = 0;
      }
      try {
        d = b.toString().split(".")[1].length;
      } catch (f) {
        d = 0;
      }
      const e = Math.pow(10, Math.max(c, d))
      return (this.accMul(a, e) - this.accMul(b, e)) / e;
    },
    // 乘法
    accMul(a, b) {
      let c = 0
      const d = a.toString()
      const e = b.toString()
      try {
        c += d.split(".")[1].length;
      } catch (f) { }
      try {
        c += e.split(".")[1].length;
      } catch (f) { }
      return Number(d.replace(".", "")) * Number(e.replace(".", "")) / Math.pow(10, c);
    },
    // 除法
    accDiv(a, b) {
      let c = 0
      let e = 0
      let f = 0
      try {
        e = a.toString().split(".")[1].length;
      } catch (g) { }
      try {
        f = b.toString().split(".")[1].length;
      } catch (g) { }
      c = Number(a.toString().replace(".", ""))
      const d = Number(b.toString().replace(".", ""))
      return this.accMul(c / d, Math.pow(10, f - e))
    },
    getFilterObj(filterObj) {
      // 获取左侧tree节点
      const str = filterObj.substring(2, filterObj.length - 2).replace(/'/g, '')
      const filterArr = str.split(',')
      const _filterValue = {}
      filterArr.map((item) => {
        const arr = item.split(':')
        _filterValue[arr[0].trim()] = arr[1]
      })
      return _filterValue
    },
    publicMakePy(str) {
      // 参数,中文字符串
      // 返回值:拼音首字母串数组
      if (typeof (str) !== "string") {
        this.$message.error(this, '函数makePy需要字符串类型参数!')
        return "";
      }
      const arrResult = []; // 保存中间结果的数组
      for (let i = 0, len = str.length; i < len; i++) {
        // 获得unicode码
        const ch = str.charAt(i);
        // 检查该unicode码是否在处理范围之内,在则返回该码对映汉字的拼音首字母,不在则调用其它函数处理
        arrResult.push(this.publicMakePyCheckCh(ch))
      }
      // 处理arrResult,返回所有可能的拼音首字母串数组
      return this.publicMakePymkRslt(arrResult)
    },
    publicMakePyCheckCh(ch) {
      const uni = ch.charCodeAt(0);
      // 如果不在汉字处理范围之内,返回原字符,也可以调用自己的处理函数
      if (uni > 40869 || uni < 19968)
        return ch; // dealWithOthers(ch);
      // 检查是否是多音字,是按多音字处理,不是就直接在strChineseFirstPY字符串中找对应的首字母
      return (this.oMultiDiff[uni] ? this.oMultiDiff[uni] : (this.strChineseFirstPY.charAt(uni - 19968)));
    },
    publicMakePymkRslt(arr) {
      let arrRslt = [""];
      for (let i = 0, len = arr.length; i < len; i++) {
        const str = arr[i];
        const strlen = str.length;
        if (strlen === 1) {
          for (let k = 0; k < arrRslt.length; k++) {
            arrRslt[k] += str;
          }
        } else {
          const tmpArr = arrRslt.slice(0);
          arrRslt = [];
          for (let k = 0; k < strlen; k++) {
            // 复制一个相同的arrRslt
            const tmp = tmpArr.slice(0);
            // 把当前字符str[k]添加到每个元素末尾
            for (let j = 0; j < tmp.length; j++) {
              tmp[j] += str.charAt(k);
            }
            // 把复制并修改后的数组连接到arrRslt上
            arrRslt = arrRslt.concat(tmp);
          }
        }
      }
      let fristreslt = "";
      if (arrRslt.length > 0) {
        fristreslt = arrRslt[0];
      }
      return fristreslt;
    },
