    formatNum(val, mask, key, callback){
      /**
       * val 使用 $event
       * mask 字符串 支持[+]仅正数，[-]仅负数，[任意数字]小数点精度
       * key 格式化后存data中哪个变量
       * callback 格式化后回调
       */
      if (val === '') {
        let obj = this
        let k = key
        while (key.indexOf('.') > -1) {
          k = key.substr(0, key.indexOf('.'))
          key = key.substr(key.indexOf('.') + 1)
          obj = obj[k]
        }
        obj[key] = ''
        if (callback && typeof callback === 'string') {
          this[callback]('')
        }
      }else if (mask && key) {
        const positive = mask.indexOf('+') > -1
        const negative = mask.indexOf('-') > -1
        const precision = mask.replace(/\D/g, '')

        let newVal = (val + '').replace(/[^0-9.-]/g, '')
        newVal = Number.parseFloat(newVal || 0)
        if (positive) {
          if (newVal < 0) newVal = 0
        }
        if (negative) {
          if (newVal > 0) newVal = 0
        }
        if (precision && precision > 0) {
          newVal = Number(newVal).toFixed(precision)
        } else if (precision === 0 || precision === '0') {
          newVal = Number.parseInt(newVal || 0)
        }
        console.log(val, newVal)

        let obj = this
        let k = key
        while (key.indexOf('.') > -1) {
          k = key.substr(0, key.indexOf('.'))
          key = key.substr(key.indexOf('.') + 1)
          obj = obj[k]
        }
        obj[key] = newVal
        if (callback) {
          if (typeof callback === 'string') {
            this[callback](newVal)
          } else if (typeof callback === 'function') {
            callback(newVal)
          }
        }
      }
    },
